import React from 'react'
import './Header.css';
const Header = () => {
  return (
    <>
<ul>
  <li><a className="li1">Home</a></li>
  <li><a href="#news">News</a></li>
  <li><a href="#contact">Contact</a></li>
  <li><a href="#about">About</a></li>
</ul>

    </>
  )
}

export default Header
